import React from "react";
import { Row, Col, Button, Typography, Progress } from "antd";
import { useRouter } from "next/router";
import { useSelector } from "react-redux";
const { Text, Paragraph } = Typography;

import calculator from "../../back/calculator";
import Feature from "../../components/Feature";

const End = () => {
	const { ans } = useSelector((state) => state.answer);
	const router = useRouter();

	const toTop = () => {
		router.push("/");
	};

	return (
		<>
			<Row justify="center">
				<Text
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "50px",
						fontSize: "20px",
					}}
				>
					나의 유형은
				</Text>
			</Row>
			<Row justify="center">
				<Text
					strong
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "5px",
						fontSize: "25px",
					}}
				>
					(여기에 유형 입력)
				</Text>
			</Row>
			<Row justify="center">
				<Text
					strong
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "5px",
						fontSize: "30px",
						color: "#be2edd",
					}}
				>
					{calculator(ans)}
				</Text>
			</Row>
			<Row>
				<img
					style={{
						display: "block",
						margin: "30px auto 30px auto",
						width: "200px",
						height: "auto",
					}}
					src={require("../../assets/dog.png")}
				/>
			</Row>

			<Feature title={"애정표현력"} value={40} />
			<Feature title={"눈치력"} value={40} />
			<Feature title={"썸추진력"} value={60} />
			<Feature title={"19금력"} value={40} />
			<Feature title={"마이웨이력"} value={100} color={"#eb4d4b"} />

			<Row justify="center">
				<Col xs={18} sm={18} md={18} lg={18} xl={18}>
					<Paragraph
						strong
						style={{
							textAlign: "center",
							display: "block",
							marginTop: "15px",
							fontSize: "15px",
						}}
					>
						당신은 이러이러한 사람이에요.
						~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
					</Paragraph>
				</Col>
			</Row>

			<Row justify="center">
				<Col xs={18} sm={18} md={18} lg={18} xl={18}>
					<Button
						style={{
							display: "block",
							marginTop: "20px",
							width: "100%",
						}}
						onClick={toTop}
					>
						처음으로
					</Button>
				</Col>
			</Row>

			<Row style={{ height: "100px" }}></Row>
		</>
	);
};

export default End;
